--
-- Table structure for table `customers`
--

DROP TABLE IF EXISTS `customers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `customers` (
  `customer_id` varchar(20) NOT NULL,
  `nik` varchar(16) NOT NULL,
  `full_name` varchar(100) NOT NULL,
  `date_of_birth` date NOT NULL,
  `gender` enum('L','P') NOT NULL,
  `marital_status` enum('Single','Married','Divorced','Widowed') NOT NULL,
  `phone_number` varchar(15) NOT NULL,
  `email` varchar(100) DEFAULT NULL,
  `address` text NOT NULL,
  `city` varchar(50) NOT NULL,
  `province` varchar(50) NOT NULL,
  `postal_code` varchar(5) NOT NULL,
  `occupation` varchar(50) NOT NULL,
  `employer_name` varchar(100) DEFAULT NULL,
  `monthly_income` decimal(15,2) NOT NULL,
  `employment_status` enum('Permanent','Contract','Self-Employed','Freelance') NOT NULL,
  `years_of_employment` int DEFAULT NULL,
  `education_level` enum('SD','SMP','SMA','D3','S1','S2','S3') NOT NULL,
  `emergency_contact_name` varchar(100) NOT NULL,
  `emergency_contact_phone` varchar(15) NOT NULL,
  `emergency_contact_relation` varchar(30) NOT NULL,
  `credit_score` int DEFAULT NULL,
  `customer_segment` enum('Premium','Gold','Silver','Bronze') NOT NULL,
  `registration_date` datetime NOT NULL,
  `last_updated` datetime NOT NULL,
  `status` enum('Active','Inactive','Blacklisted') DEFAULT 'Active',
  `created_by` varchar(50) DEFAULT 'SYSTEM',
  `updated_by` varchar(50) DEFAULT 'SYSTEM',
  PRIMARY KEY (`customer_id`),
  UNIQUE KEY `nik` (`nik`),
  KEY `idx_customer_nik` (`nik`),
  KEY `idx_customer_status` (`status`),
  KEY `idx_customer_segment` (`customer_segment`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

