DROP TABLE IF EXISTS `vehicle_ownership`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `vehicle_ownership` (
  `ownership_id` varchar(20) NOT NULL,
  `customer_id` varchar(20) NOT NULL,
  `vehicle_type` enum('Motor','Mobil','Truk','Bus') NOT NULL,
  `brand` varchar(50) NOT NULL,
  `model` varchar(50) NOT NULL,
  `year` int NOT NULL,
  `vehicle_price` decimal(15,2) NOT NULL,
  `purchase_date` date NOT NULL,
  `ownership_status` enum('Owned','Financed','Completed') NOT NULL,
  `registration_number` varchar(15) DEFAULT NULL,
  `chassis_number` varchar(30) DEFAULT NULL,
  `engine_number` varchar(30) DEFAULT NULL,
  `created_date` datetime NOT NULL,
  PRIMARY KEY (`ownership_id`),
  KEY `idx_vehicle_customer` (`customer_id`),
  CONSTRAINT `vehicle_ownership_ibfk_1` FOREIGN KEY (`customer_id`) REFERENCES `customers` (`customer_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
